(1,1,'SDFMG','Weapon','Dispara rápidamente balas con una probabilidad del 20% de disparar en su lugar un cohete de agua que se dirige a los enemigos.','Ranger'),
(2,2,'Fathom Swarmer armor','Armor','Incremento del 10% al daño de invocador y +2 súbditos máximos. Otorga la habilidad de escalar paredes. Incremento del 30% al daño de invocador mientras se esté sumergido en líquidos. Provee una cantidad moderada de luz y reduce la perdida aire en el abismo.','Summoner');
